import React from 'react';
const Home=()=>{
    document.getElementsByClassName('home')[0];

    return( 
      
        <div class="home">
           Science, also widely referred to as 
               Science Magazine, is the peer-reviewed 
               academic journal of the American Association for the Advancement of Science and one of the world's top academic journals. It was first published in 1880, is currently circulated weekly and has a subscriber base of around 130,000. 
               Because institutional subscriptions and online 
               access serve a larger audience, its estimated 
               readership is 570,400 people.
               In new book, British teen climate activist urges peers to 'Challenge Everything' Blue Sandford turned 17 in a police cell. Now, the British environmental activist has written a book for fellow teens who want to act on climate change but do not know where to start. In "Challenge Everything," 
               which was published in Europe and</div>
 
    );
}
export default Home;
